import React from 'react';
import "./OurCompany.css";

const OurCompany = () => (
    <div className="Company">
        <div className="lander">
            <h1>Our Company</h1>
            <br/>
            <p>This is the about page!</p>
        </div>
    </div>
);

export default OurCompany;
